#include<bits/stdc++.h>using namespace std;typedef long long ll;void f(ll n,vector<ll>&a){    for(ll i=0;i<n;i++)cin>>a[i];}void solve(){    ll n,q;    cin>>n;    vector<ll>arr(n);    f(n,arr);    vector<ll>diff(n,-1);    for (ll i = 1; i < n; i++)    {        if(arr[i]!=arr[i-1])diff[i]=i-1;        else diff[i]=diff[i-1];    }    cin>>q;    for (ll i = 0; i < q; i++)    {        ll l,r;        cin>>l>>r;        l-=1,r-=1;        if(diff[r]<l)cout<<"-1 -1"<<'\n';        else cout<<diff[r]+1<<" "<<r+1<<'\n';    }    cout<<'\n';} int main(){ios::sync_with_stdio(0);cin.tie(0);ll t;cin>>t;while (t--){    solve();}     return 0;}